import React, { memo } from 'react';
import styled from 'styled-components';
import ItemBasket from './ItemBasket';

const Bottom =styled.div`
    width: 100vw;
    border: 3px solid gray;
    height: 300px;

`;
const Footer = memo(() => {
    return (
        <Bottom>
            <ItemBasket/>
        </Bottom>
    );
});

export default Footer;
